import React, { useState, useEffect }from 'react'
import CribsFilter from './CribsFilter'
import CribsList from './CribsList'
import Footer from './Footer'

function  CribsContainer() {
  const [cribs, setCribs]= useState([])

  useEffect(() =>{
    fetch("http://localhost:3000/cribs")
    .then((response) =>response.json())
    .then(data =>setCribs(data))
  }, [])
  return (

   <>
    <CribsFilter/>
    <CribsList cribs={cribs}/>
    <Footer/>
   </>
  )
}

export default  CribsContainer
